# Structure for table "mini_auth_group_access"
#

DROP TABLE IF EXISTS `mini_auth_group_access`;
CREATE TABLE `mini_auth_group_access` (
  `uid` int(10) unsigned NOT NULL COMMENT '会员ID',
  `group_id` int(10) unsigned NOT NULL COMMENT '级别ID',
