INSERT INTO `mini_content_headline` VALUES (1,'重要提醒！世卫组织：洪水接触的所有食物需丢弃','<p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">近日，世卫组织官微发出提醒，洪涝可能会增加水和病媒传播疾病的传播，包括伤寒，霍乱，疟疾和黄热病等。世卫组织提示，如果发生洪涝，需要注意保护水源，包括：将所有饮用水和准备食物的水氯化或煮沸；不使用洪水洗碗，洗漱和准备食物。如果接触过洪水，务必用肥皂和水洗手；避免步行或开车经过水灾或有积水的地区；丢弃与洪水接触的所有食物等。</span></p><div class=\"img-container\" style=\"margin-top: 30px; font-family: arial; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);\"><img class=\"large\" src=\"https://com-mini.oss-cn-beijing.aliyuncs.com/uploads/20200714/dd483285d52425126450b15749fa49bc.jpg\" style=\"border: 0px; width: 600px; display: block;\"/></div><p style=\"margin-top: 26px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\">网友评论</p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">网友：快告诉爷爷奶奶！</span></p><div class=\"img-container\" style=\"margin-top: 30px; font-family: arial; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);\"><img class=\"large\" src=\"https://com-mini.oss-cn-beijing.aliyuncs.com/uploads/20200714/77f22200696333d81130d1c0f12a7775.jpg\" style=\"border: 0px; width: 600px; display: block;\"/></div><div class=\"img-container\" style=\"margin-top: 30px; font-family: arial; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);\"><img class=\"large\" src=\"https://com-mini.oss-cn-beijing.aliyuncs.com/uploads/20200714/a73a5ff68c7531cdab58030b94d98a47.jpg\" style=\"border: 0px; width: 600px; display: block;\"/></div><div class=\"img-container\" style=\"margin-top: 30px; font-family: arial; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);\"><img class=\"large\" src=\"https://com-mini.oss-cn-beijing.aliyuncs.com/uploads/20200714/39da86edbe400b0556b0a0126f487996.jpg\" style=\"border: 0px; width: 600px; display: block;\"/></div><p style=\"margin-top: 26px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-strong\" style=\"font-size: 18px; font-weight: 700;\">延伸阅读：</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-strong\" style=\"font-size: 18px; font-weight: 700;\">江西遭遇本世纪最大洪水 湖区所有单退圩堤开闸分洪</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">连日来，受江西省强降雨和长江来水影响，江西省遭遇本世纪以来最大洪水，记者从江西防指获悉，7月13日江西省湖区所有单退圩堤将开闸清堰分蓄洪水。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">据了解，江西省鄱阳湖区和长江九江段防汛形势异常严峻，鄱阳湖星子站已高于1998年历史最高洪水位，根据《江西省实施〈中华人民共和国防洪法〉办法》，为最大限度减少灾害损失，切实做好当前防汛工作，确保人民群众生命安全，7月13日凌晨，江西省防指下发紧急通知，要求湖区所有单退圩堤必须于7月13日主动开闸清堰分蓄洪水，分洪前必须提前对圩区内可能出现的人员进行清场。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">江西省防指要求，鄱阳湖流域干支流所有水库要统筹兼顾、科学调度，在确保工程安全的情况下，尽量减少下泄流量，充分发挥拦洪错峰作用，为减轻鄱阳湖区、长江九江段防汛压力提供有力保障；对于部分已发生超标准洪水、尚未完成除险加固、防御能力明显不足的1-5万亩圩堤，为防止溃口，可采取引水入圩，减小堤防内外压差的方法，主动防御；在科学防御超历史特大洪水过程中，坚持人民至上生命至上，全力以赴应对超标准特大洪水导致的各种险情，切实把确保人民群众生命安全落到实处。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">我国最大淡水湖水位突破1998年极值，鄱阳湖一堤之隔泾渭分明</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">12日，鄱阳湖标志性水文站星子站的水位井内，湖水漫过一道红色标记——“1998年洪水位22.52M”，这标志着我国最大淡水湖水位突破1998年极值。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">12日下午，航拍位于鄱阳湖东岸的江西鄱阳县珠湖联圩，一侧为清澈的鄱阳湖内湖珠湖，一侧为因暴雨变浑浊的鄱阳湖外湖，呈现一堤之隔泾渭分明的景观。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\">来源：北晚新视觉综合 中国新闻网 网友评论 江西新闻网</p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\">流程编辑：TF021</p><p><br/></p>',1,1594724346,1594724346),(2,'北京集中上调2020相关社保待遇：养老金每人每月增加50元','<p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">来源：央视</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">原标题：北京集中上调2020年相关社保待遇：养老金每人每月增加50元</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">7月14日，北京市人社局发布了北京市2020年相关社会保障待遇集中调整方案，包括企业和机关事业单位退休人员养老金、城乡居民基础养老金和福利养老金、工伤保险定期待遇和失业保险金，惠及全市近397万人。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">今年的调整将继续按照定额调整、挂钩调整与适当倾斜相结合的办法进行，继续保持向退休时间早、连续工龄和缴费年限长的退休人员加大倾斜力度的调整办法。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">定额调整基本养老金：每名退休人员，每人每月增加50元。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\"><span class=\"bjh-strong\" style=\"font-size: 18px; font-weight: 700;\">　挂钩调整基本养老金：</span></span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\"><span class=\"bjh-strong\" style=\"font-size: 18px; font-weight: 700;\">（一）与缴费年限挂钩</span></span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">其中，缴费年限满10年及以上的退休人员，缴费年限每满1年，每月增加3元；对于不足整年的月数，每月增加0.25元。缴费年限不满10年的（不含建设征地农转工退休人员），每人每月增加30元；缴费年限不满15年的建设征地农转工退休人员，每人每月增加45元。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\"><span class=\"bjh-strong\" style=\"font-size: 18px; font-weight: 700;\">（二）与养老金水平挂钩</span></span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">按照退休人员2019年年底前的月基本养老金水平，以2019年本市居民人均可支配收入水平（5646元）为基准线划分两档，5646元（含）以上的每人每月增加30元，5646元以下每人每月增加65元。通过采取低者高调、高者低调的方式，保障待遇水平偏低的人员能够适当多增加基本养老金。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">同时，为了兼顾公平，针对少数退休人员按与养老金水平挂钩调整后低于5711元的，还将进行差额补足（仅限于调整前月养老金水平在5646元及以上的退休人群）。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\"><span class=\"bjh-strong\" style=\"font-size: 18px; font-weight: 700;\">适当向高龄退休人员倾斜</span></span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">对在2019年12月31日（含）之前已经年满65周岁及以上的高龄退休人员，在按照上述办法进行调整后，再次享受到45元至75元四个档次的倾斜政策。即：65至69周岁的退休人员每人每月再增加45元；70至74周岁每人每月再增加55元；75至79周岁每人每月再增加65元；80周岁以上每人每月再增加75元。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">在此基础上，继续对65岁以上退休人员中缴费年限满30年的，每人每月再增加5元，以体现对退休时间早、连续工龄和缴费年限长的退休人员进一步倾斜。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\"><span class=\"bjh-strong\" style=\"font-size: 18px; font-weight: 700;\">两种特殊的调整方式：</span></span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">一是继续单列调整企业新中国成立前参加革命工作的老工人退休待遇。以参加革命工作时间进行调整，即1937年7月7日至1945年9月2日参加革命工作的，每人每月增加375元；1945年9月3日至1949年9月30日参加革命工作的，每人每月增加345元。在上述两档标准的调整基础之上，他们还享受高龄退休人员的倾斜政策，本次调整普遍增加420至450元/月。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">二是保证企业退休军转干部、原工商业者调整后不低于全市养老金的平均水平。按照定额、与缴费年限挂钩调整和与养老金水平挂钩调整后，企业退休军转干部、原工商业者养老金低于调整后全市企业退休人员养老金平均水平的，补足到平均水平。同时，在2019年12月31日（含）之前已经年满65周岁及以上的高龄退休人员，还享受高龄退休人员的倾斜政策。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">本市机关事业单位2019年12月31日（含）前退休的人员，也将按照上述定额调整、挂钩调整与适当倾斜相结合的办法和调整标准进行调整，并于7月底前发放到位。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\"><span class=\"bjh-strong\" style=\"font-size: 18px; font-weight: 700;\">　调整城乡居民养老保障相关待遇标准</span></span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">享受基础养老金和福利养老金待遇群体每人每月增加20元。城乡居民基础养老金人均月领取标准达到830元，福利养老金人均745元。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\"><span class=\"bjh-strong\" style=\"font-size: 18px; font-weight: 700;\">继续调整工伤人员伤残津贴和供养亲属抚恤金待遇</span></span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">本次调整范围为2019年12月31日（含）前享受伤残津贴待遇的工伤人员（不包括领取基本养老金的退休人员）、享受供养亲属抚恤金待遇的工亡人员供养亲属。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">调整一至四级工伤人员伤残津贴。根据伤残等级每人每月分别增加：一级伤残420元，二级伤残390元，三级伤残360元，四级伤残330元。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">调整供养亲属抚恤金。工亡人员供养亲属抚恤金的调整，每人每月增加200元。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">工伤人员伤残津贴和工亡人员供养亲属抚恤金调整，自2020年1月1日起执行。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">调整五、六级工伤人员伤残津贴。用人单位未安排工作的五、六级工伤人员，用人单位应当为其增加伤残津贴，每人每月增加额不得低于220元。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">因生活护理费计发基数暂未公布，待公布后另行发布。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\"><span class=\"bjh-strong\" style=\"font-size: 18px; font-weight: 700;\">本月起失业保险金每档上调110元</span></span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">2020年的失业保险金标准在现行基础上每档上调110元。其中，累计缴费时间满1年不满5年的，失业保险金月发放标准为1816元；累计缴费时间满5年不满10年的，失业保险金月发放标准为1843元；累计缴费时间满10年不满15年的，失业保险金月发放标准为1870元；累计缴费时间满15年不满20年的，失业保险金月发放标准为1897元；累计缴费时间满20年以上的，失业保险金月发放标准为1925元。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">此项调整自2020年7月1日起执行。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\"><span class=\"bjh-strong\" style=\"font-size: 18px; font-weight: 700;\">最低工资标准今年暂缓调整</span></span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">考虑到新冠肺炎疫情对经济社会的影响，2020年北京市最低工资标准暂缓调整。适用于全日制从业人员的月最低工资标准继续为2200元，适用于非全日制从业人员的小时最低工资标准继续为24元，适用于非全日制从业人员法定节假日小时最低工资标准继续为56元。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">这是在当前受疫情影响，财政收入放缓，实施社会保险费阶段性减免政策使养老保险基金收支压力进一步加大的背景下，北京市继续提高保障和改善民生的重要举措。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">（总台央视记者 张伟泽 邓煜洲）</span></p><p><br/></p>',2,1594724390,1594724403),(3,'南昌一地下车库40多根承重柱开裂 初步判断为地下水浮力增大导','<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0.2rem; line-height: 1.8; color: rgb(68, 68, 68); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, Ubuntu, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, &quot;Source Han Sans CN&quot;, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">今天来聊聊一篇关于南昌一地下车库40多根承重柱开裂，初步判断为地下水浮力增大导致柱体裂缝的文章,现在就为大家来简单介绍下南昌一地下车库40多根承重柱开裂，初步判断为地下水浮力增大导致柱体裂缝,希望对各位小伙伴们有所帮助。</p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0.2rem; line-height: 1.8; color: rgb(68, 68, 68); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, Ubuntu, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, &quot;Source Han Sans CN&quot;, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><img alt=\"\" src=\"https://com-mini.oss-cn-beijing.aliyuncs.com/uploads/20200714/44a6fce8104c3bd0c6f710c03da6ba9b.jpg\" style=\"box-sizing: border-box; border: 0px; vertical-align: top; height: auto; max-width: 100%;\"/></p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0.2rem; line-height: 1.8; color: rgb(68, 68, 68); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, Ubuntu, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, &quot;Source Han Sans CN&quot;, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">近日，南昌鸿海万科天空之城车库多根柱体出现爆裂，同时部分墙体开裂，地基下沉。7月12日，开发商江西鸿海置业有限公司发布声明称:情况属实，已上报政府主管部门。经相关专家现场查勘，受南昌市连续强降水影响，此部分地库尚在施工中，顶板覆土还未完成，初步判断为地下水浮力增大导致柱体裂缝，具体原因待进一步分析。</p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0.2rem; line-height: 1.8; color: rgb(68, 68, 68); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, Ubuntu, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, &quot;Source Han Sans CN&quot;, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">相信通过南昌一地下车库40多根承重柱开裂，初步判断为地下水浮力增大导致柱体裂缝这篇文章能帮到你，在和好朋友分享的时候，也欢迎感兴趣小伙伴们一起来探讨。</p><p><br/></p>',3,1594724444,1594724444),(4,'美国新冠确诊数占全球1/4以上 几乎每100人中就有一人感染','<p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">据美国约翰斯·霍普金斯大学疫情实时监测系统显示，截至美东时间7月13日下午5时34分，全球累计新冠病毒感染病例13026225例，累计死亡病例570924例。美国已有感染病例3352696例，占全球感染病例1/4以上，其中包括死亡病例135512例。与该系统7月12日下午6点的数据相比，美国新增感染病例59762例，新增死亡病例372例。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">美国有线电视新闻网指出，根据约翰斯·霍普金斯大学的最新数据，几乎每100个美国人中就有一人感染新冠病毒。美国民主基金和加州大学洛杉矶分校近日发布的一项调查显示，超过1/3（36%）的美国人表示，除了直系亲属和工作中认识的人以外，身边有人已经感染了新冠病毒。这个数字自3月份以来增加了两倍多，3月中旬，有11%的美国人表示同样的看法。</span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\"><span class=\"bjh-strong\" style=\"font-size: 18px; font-weight: 700;\">全球新冠肺炎病例超1300万 美国是疫情最严重国家</span></span></p><p style=\"margin-top: 22px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"bjh-p\">据美国约翰斯·霍普金斯大学疫情实时监测系统，截至美东时间7月13日下午6时34分，全球累计新冠病毒感染病例13048249例，累计死亡病例571685例。美国是全球疫情最严重的国家，累计感染病例3353348例，巴西累计感染病例1884967例，印度累计感染病例878254例，俄罗斯累计感染病例732547例。累计感染病例超过25万例的国家还有秘鲁、智利、墨西哥、英国、南非、伊朗、西班牙和巴基斯坦。累计死亡病例超过3万例的国家还有英国、墨西哥、意大利和法国。</span></p><div class=\"img-container\" style=\"margin-top: 30px; margin-bottom: 4px; font-family: arial; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);\"><img class=\"large\" src=\"https://com-mini.oss-cn-beijing.aliyuncs.com/uploads/20200714/0b90f1f149fac2da948ec930a24c80b3.jpg\" style=\"border: 0px; width: 600px; display: block;\"/></div><p><br/></p>',4,1594724471,1594724471);

