INSERT INTO `mini_content_help` VALUES (1,'<div class=\"article-head\" style=\"box-sizing: inherit; -webkit-tap-highlight-color: transparent; text-size-adjust: none; -webkit-font-smoothing: antialiased; padding: 10px 20px; height: 50px; display: flex; color: rgba(0, 0, 0, 0.87); font-family: &quot;Helvetica Neue&quot;, NotoSansHans-Regular, AvenirNext-Regular, arial, &quot;Hiragino Sans GB&quot;, &quot;Microsoft Yahei&quot;, &quot;WenQuanYi Micro Hei&quot;, Arial, Helvetica, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><h1 style=\"box-sizing: inherit; -webkit-tap-highlight-color: transparent; text-size-adjust: none; -webkit-font-smoothing: antialiased; font-size: 20px; margin: 0px; padding: 0px; line-height: 30px; font-weight: 200; min-height: 1rem; flex: 1 1 0%; text-align: center; overflow: hidden; text-overflow: ellipsis; white-space: nowrap; color: rgb(126, 136, 139);\">如何注册微信小程序</h1><div class=\"right tools\" style=\"box-sizing: inherit; -webkit-tap-highlight-color: transparent; text-size-adjust: none; -webkit-font-smoothing: antialiased; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; margin: 0px -10px; position: fixed; z-index: 20; right: 20px;\"><div class=\"ui top right pointing dropdown item\" style=\"box-sizing: inherit; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); text-size-adjust: none; -webkit-font-smoothing: antialiased; cursor: pointer; position: relative; outline: none; text-align: center; transition: box-shadow 0.1s ease 0s, width 0.1s ease 0s; color: rgb(126, 136, 139); height: 30px; padding: 0px 10px; text-transform: uppercase; line-height: 30px;\"><div class=\"text\" style=\"box-sizing: inherit; -webkit-tap-highlight-color: transparent; text-size-adjust: none; -webkit-font-smoothing: antialiased; display: inline-block; transition: none 0s ease 0s;\"></div><span class=\"share alternate icon\" style=\"box-sizing: inherit; -webkit-tap-highlight-color: transparent; text-size-adjust: none; -webkit-font-smoothing: antialiased; display: inline-block; opacity: 1; margin: 0px 0.25rem 0px 0px; width: auto; height: auto; font-family: Icons; text-decoration: inherit; speak: none; backface-visibility: hidden; font-size: 1em; color: rgb(204, 204, 204);\"></span></div></div></div><div class=\"article-body kancloud-markdown-body\" style=\"box-sizing: inherit; -webkit-tap-highlight-color: transparent; text-size-adjust: none; -webkit-font-smoothing: antialiased; max-width: 980px; padding: 9px 24px; line-height: 1.2; font-size: 15px; overflow-wrap: break-word; color: rgb(82, 82, 82); font-family: &quot;Helvetica Neue&quot;, NotoSansHans-Regular, AvenirNext-Regular, arial, &quot;Hiragino Sans GB&quot;, &quot;Microsoft Yahei&quot;, &quot;WenQuanYi Micro Hei&quot;, serif; white-space: normal; background-color: rgb(255, 255, 255); margin-left: auto !important; margin-right: auto !important;\"><p style=\"box-sizing: inherit; -webkit-tap-highlight-color: transparent; text-size-adjust: none; -webkit-font-smoothing: antialiased; margin-top: 0px; margin-bottom: 0px; line-height: 2; padding: 0px;\">方法一，<br/>使用已经注册好了，并且通过微信认证的公众号绑定使用小程序。</p><p style=\"box-sizing: inherit; -webkit-tap-highlight-color: transparent; text-size-adjust: none; -webkit-font-smoothing: antialiased; margin-top: 0px; margin-bottom: 0px; line-height: 2; padding: 0px;\">方法二，<br/>访问微信公众平台，选择注册账号，选择小程序注册，按照需求填写即可。</p><p style=\"box-sizing: inherit; -webkit-tap-highlight-color: transparent; text-size-adjust: none; -webkit-font-smoothing: antialiased; margin-top: 0px; margin-bottom: 0px; line-height: 2; padding: 0px;\"><a href=\"https://mp.weixin.qq.com/\" target=\"_blank\" style=\"box-sizing: inherit; -webkit-tap-highlight-color: transparent; text-size-adjust: none; -webkit-font-smoothing: antialiased; background-color: transparent; color: rgb(65, 131, 196); text-decoration-line: none;\">https://mp.weixin.qq.com</a></p><p style=\"box-sizing: inherit; -webkit-tap-highlight-color: transparent; text-size-adjust: none; -webkit-font-smoothing: antialiased; margin-top: 0px; margin-bottom: 0px; line-height: 2; padding: 0px;\"><img src=\"https://box.kancloud.cn/4c7a20cbdeb4b272cae957d699e06530_2648x1880.png\" alt=\"\" style=\"box-sizing: inherit; -webkit-tap-highlight-color: transparent; text-size-adjust: none; -webkit-font-smoothing: antialiased; border-style: none; max-width: 100%; display: inline-block; padding: 3px; vertical-align: middle;\"/></p><p style=\"box-sizing: inherit; -webkit-tap-highlight-color: transparent; text-size-adjust: none; -webkit-font-smoothing: antialiased; margin-top: 0px; margin-bottom: 0px; line-height: 2; padding: 0px;\"><img src=\"https://box.kancloud.cn/dcc9f1b1d29ffa0059374e0cb3f57ee5_2648x1880.png\" alt=\"\" style=\"box-sizing: inherit; -webkit-tap-highlight-color: transparent; text-size-adjust: none; -webkit-font-smoothing: antialiased; border-style: none; max-width: 100%; display: inline-block; padding: 3px; vertical-align: middle;\"/></p><p style=\"box-sizing: inherit; -webkit-tap-highlight-color: transparent; text-size-adjust: none; -webkit-font-smoothing: antialiased; margin-top: 0px; margin-bottom: 0px; line-height: 2; padding: 0px;\">根据需求去填写即可。</p></div><p><br/></p>');

#
# Structure for table "mini_ems"
#

DROP TABLE IF EXISTS `mini_ems`;
CREATE TABLE `mini_ems` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `event` varchar(30) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '事件',
  `email` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '邮箱',
  `code` varchar(10) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '验证码',
  `times` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '验证次数',
  `ip` varchar(30) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT 'IP',
  `createtime` int(10) unsigned DEFAULT '0' COMMENT '创建时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci ROW_FORMAT=COMPACT COMMENT='邮箱验证码表';

