#
# Structure for table "mini_good"
#

DROP TABLE IF EXISTS `mini_good`;
CREATE TABLE `mini_good` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `shop_id` int(11) NOT NULL DEFAULT '0' COMMENT '商家',
  `shop_category_id` int(11) NOT NULL DEFAULT '0' COMMENT '分类',
  `name` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '名称',
  `original` decimal(10,2) NOT NULL COMMENT '原价',
  `price` decimal(10,2) NOT NULL COMMENT '售价',
  `stock` int(11) unsigned NOT NULL COMMENT '库存',
  `thumb_image` varchar(100) CHARACTER SET utf8mb4 NOT NULL DEFAULT '' COMMENT '缩略图',
  `images` varchar(500) CHARACTER SET utf8mb4 NOT NULL DEFAULT '' COMMENT '商品图片【多选】',
  `short` varchar(100) CHARACTER SET utf8mb4 NOT NULL DEFAULT '' COMMENT '简介',
  `content` text CHARACTER SET utf8mb4 NOT NULL COMMENT '详情',
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '状态:0=下架,1=上架',
  `weigh` int(10) NOT NULL DEFAULT '0' COMMENT '权重',
  `createtime` int(10) DEFAULT NULL COMMENT '创建时间',
  `updatetime` int(10) DEFAULT NULL COMMENT '更新时间',
  `deletetime` int(10) DEFAULT NULL COMMENT '删除时间',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `shop_id` (`shop_id`,`shop_category_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=35 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci ROW_FORMAT=COMPACT COMMENT='商品表';

