# Structure for table "mini_shop"
#

DROP TABLE IF EXISTS `mini_shop`;
CREATE TABLE `mini_shop` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `parent_id` int(11) NOT NULL COMMENT '推广人',
  `user_id` int(11) NOT NULL DEFAULT '0' COMMENT '用户',
  `category_id` int(11) NOT NULL DEFAULT '0' COMMENT '经营行业',
  `name` varchar(30) CHARACTER SET utf8mb4 NOT NULL DEFAULT '' COMMENT '名称',
  `logo_image` varchar(100) CHARACTER SET utf8mb4 NOT NULL DEFAULT '' COMMENT 'logo',
  `short` varchar(150) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '简介',
  `contact` varchar(20) CHARACTER SET utf8mb4 NOT NULL DEFAULT '' COMMENT '联系人',
  `phone` char(11) CHARACTER SET utf8mb4 NOT NULL DEFAULT '' COMMENT '手机号',
  `password` char(32) CHARACTER SET utf8mb4 NOT NULL DEFAULT '' COMMENT '密码',
  `status` enum('0','1','2','3') CHARACTER SET utf8mb4 NOT NULL DEFAULT '2' COMMENT '状态:0=禁用,1=正常,2=审核中,3=审核失败',
  `weigh` int(10) NOT NULL DEFAULT '0' COMMENT '权重',
  `createtime` int(10) NOT NULL DEFAULT '0' COMMENT '创建时间',
  `updatetime` int(10) NOT NULL DEFAULT '0' COMMENT '更新时间',
  `deletetime` int(10) DEFAULT NULL COMMENT '删除时间',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE KEY `phone` (`phone`) USING BTREE,
  UNIQUE KEY `user_id` (`user_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=14 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci ROW_FORMAT=COMPACT COMMENT='商家表';

