DROP TABLE IF EXISTS `mini_user_address`;
CREATE TABLE `mini_user_address` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL COMMENT '用户ID',
  `longitude` decimal(13,10) NOT NULL COMMENT '经度',
  `latitude` decimal(13,10) NOT NULL COMMENT '纬度',
  `address` varchar(150) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '收货地址',
  `doorplate` varchar(15) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '门牌号',
  `contact` varchar(50) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '联系人',
  `phone` char(11) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '手机号',
  `default` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否默认:0=正常,1=默认',
  `createtime` int(10) NOT NULL DEFAULT '0' COMMENT '创建时间',
  `updatetime` int(10) NOT NULL DEFAULT '0' COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `user_id` (`user_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci ROW_FORMAT=COMPACT COMMENT='用户地址表';

